import {useState, useEffect} from "react";

const Form = () => {
    const [kiosks, setKiosks] = useState(null)
    
    useEffect(() => {
        fetch('http://localhost:8000/kiosk')
        .then(res => {
            return res.json();
        })
        .then(data => {
            setKiosks(data);
            console.log(kiosks);
        })
    }, [])
    //const { error, isPending, data: kiosks } = useFetch('http://localhost:8000/kiosk');

    return ( 
        <h1>test</h1>
        /*
        <div>
            {kiosks.map(kiosk => (
                <div>
                <h2>Location of {kiosk.name}</h2>
                <h2>{kiosk.latitude}</h2>
                <h2>{kiosk.longitude}</h2>
                </div>
            ))}
        </div>*/
     );
}
 
export default Form;
